import React from 'react';
import { Input } from './ui/Input';
import { Label } from './ui/Label';
import { Button } from './ui/Button';

const Step1 = ({ nextStep, handleInputChange, formData }) => {
  const handleSubmit = (e) => {
    e.preventDefault();
    nextStep();
  };

  return (
    <div className="max-w-3xl mx-auto bg-white p-8 rounded-lg shadow-md">
      <h2 className="text-3xl font-bold mb-4">Primary Contact</h2>
      <p className="mb-6 text-gray-600">
        Please enter the contact information for the primary person who will manage and oversee your Audiology Plus onboarding. This contact will have administrative access to all aspects of our service and be the person we communicate with most frequently.
      </p>
      <form onSubmit={handleSubmit}>
        <div className="space-y-4">
          <div>
            <Label htmlFor="primaryContactName">Primary Contact name</Label>
            <Input
              id="primaryContactName"
              name="primaryContactName"
              value={formData.primaryContactName || ''}
              onChange={handleInputChange}
              placeholder="Enter full name"
              required
              className="w-full"
            />
          </div>
          <div>
            <Label htmlFor="primaryContactEmail">Primary Contact email</Label>
            <Input
              id="primaryContactEmail"
              name="primaryContactEmail"
              type="email"
              value={formData.primaryContactEmail || ''}
              onChange={handleInputChange}
              placeholder="Enter email address"
              required
              className="w-full"
            />
          </div>
          <div>
            <Label htmlFor="phoneNumber">Phone number</Label>
            <Input
              id="phoneNumber"
              name="phoneNumber"
              type="tel"
              value={formData.phoneNumber || ''}
              onChange={handleInputChange}
              placeholder="(201) 555-0123"
              required
              className="w-full"
            />
          </div>
          <div>
            <Label htmlFor="position">Position</Label>
            <Input
              id="position"
              name="position"
              value={formData.position || ''}
              onChange={handleInputChange}
              placeholder="Enter job title"
              required
              className="w-full"
            />
          </div>
        </div>
        <div className="mt-6 flex justify-between">
          <Button type="button" variant="outline" disabled>Prev</Button>
          <Button type="submit">Next</Button>
        </div>
      </form>
    </div>
  );
};

export default Step1;
